import React from 'react';
import styles from './card.module.css'
import img from '../../assets/images/carousel/img2.jpg'

const Card = () => {
    return (
        <div className={styles.card}>
            <img src={img} alt="card_img" />
            <div className={styles.info}>
                <div className={styles.infoTop}>
                    <h2 className={styles.nameCar}>Subaru LEVORG VN5</h2>
                    <div className={styles.mileage}>2021 • Гибрит • 10 000 км</div>
                </div>
                <div className={styles.infoBottom}>
                    <h2 className={styles.price}>2 115 600 ₽</h2>
                    <button className={styles.btn}>Оставить заявку</button>
                </div>
            </div>
        </div>
    );
}

export default Card;
